import React from 'react';
import { Card, CardContent, Typography, CardMedia } from '@mui/material';

const SkillCard = ({ skill }) => {
    return (
        <Card>
            {/* 이미지를 추가하려면 CardMedia 컴포넌트를 사용합니다. */}
            <CardMedia
                component="img"
                alt={skill.name}
                height="140"
                image={skill.image}  // skill 객체에 이미지 경로 또는 URL을 가리키는 속성을 추가해야 합니다.
            />
            <CardContent>
                <Typography variant="h6" gutterBottom>
                    {skill.name}
                </Typography>
                <Typography variant="body2" color="text.secondary">
                    {skill.description}
                </Typography>
            </CardContent>
        </Card>
    );
};

export default SkillCard;
